import "./admin.css";

export default function AdminLayout() {
  return (
    <div className="admin-container">
      <aside className="admin-sidebar">
        <h2>Админ-панель</h2>
        <nav>
          <Link to="users">Пользователи</Link>
          {/* позже добавим товары, заказы и т.д. */}
        </nav>
      </aside>
      <main className="admin-main">
        <Outlet />
      </main>
    </div>
  );
}
